export default function StarRating({ rating }) {
  const stars = [];
  for (let i = 1; i <= 5; i++) {
    stars.push(
      <svg
        key={i}
        className={`w-5 h-5 ${
          i <= rating ? "text-yellow-500" : "text-gray-300"
        }`}
        fill="currentColor"
        viewBox="0 0 20 20"
      >
        <path d="M10 15l-5.878 3.09 1.123-6.545L.368 7.363l6.562-.954L10 .536l3.07 5.873 6.562.954-4.878 4.182 1.123 6.545z" />
      </svg>
    );
  }
  return <div className="flex">{stars}</div>;
}
